  \"Breeding density, nesting habitat, and predators of the California Clapper Rail\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 0,\n\t\t\"recent\": 0\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-07-27T22:19:22.324592\",\n\t\"name\": \"breeding-density-nesting-habitat-and-predators-of-the-california-clapper-rail\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"We studied the breeding density and nesting
  activities of the California clapper rail (Rallus longirostris obsoletus) in south
  San Francisco Bay between April and July 1989. The highest breeding density was
  found in Dumbarton Marsh with 0.64 rails/ha. The highest concentrations of clapper
  rail pairs occurred in low to mid-marsh areas containing a predominance of pickleweed
  and cordgrass and a well developed network of tidal sloughs which provide essential
  foraging habitat and escape routes from predators. Twenty four nests were monitored
  in two marshes. Most nests were observed, in the low to mid-marsh areas containing
  pickleweed and were associated with tidal sloughs. Clutch size averaged 7.47 u00b1
  1.12 (n = 19) and 25% of the nests hatched successfully. The majority of nest losses
  were attributed to rats and raccoons. Spotlight surveys indicated the presence of
  terrestrial predators in high concentrations. We compared our results to previous
  surveys and concluded that the clapper rail population within our study area has
  declined severely. We recommend the implementation of a predator management plan
  and the restoration of rail habitat with adequate buffer areas.\",\n\t\"license_title\":
